import React, {Component} from 'react';
import 'C:/Users/Gebruiker/Desktop/Engineering/demo/src/src/webapp/src/App.css';

class MobileMenu extends Component {

    onload() {
        const settingsPanel = document.getElementById("settingsPanel");

        if(settingsPanel.style.display === "none") {
            document.getElementById("settingsPanel").style.display = "initial";
        }
        else document.getElementById("settingsPanel").style.display = "none";

    }

    render() {
        return (
            <div className="mobileMenu">
                <img alt="" id="accountButton" className="MobileAccountImage" src={require('./Images/pf.png')}/>
                <img onClick={this.onload} alt="" id="settingsButton" src={require('./Images/gear.png')}/>
            </div>
        );
    }
}

export default MobileMenu;
